window.bookSummaryJSON = "<p>The NPCs in one small corner of the map now seek their own path instead of remaining content with what they were born knowing. While some choose to look inward and explore themselves, others reach outward into new lands and untapped resources.</p> <p>However, many more mysterious corners remain where a cosmic infection that abhors such displays of self-consciousness still twists and writhes throughout Mother Sana.</p> <p>When the Blackmoor royal entourage sails across the sea to visit a powerful distant Town, Jack focuses his gaze on finding out why these virtual souls fixated on their verdant gardens for thousands of years instead of the rotting world around them.</p> <p>About 90,000 words</p>"; 
